        <View>
            <Input placeholder='Username'
                leftIcon={
                    <Icon
                name='user'size={24}
                color='black'/>
                }/>
                 <Input placeholder='Password'
                leftIcon={
                    <Icon
                name='user'size={24}
                color='black'/>
                }/>
        </View>
    );
}

export default Login;
